       # 28*28\n","hidden1_size = 256\n","hidden2_size = 128\n","\n","# tf.data APIÎ•º Ïù¥Ïö©Ìï¥ÏÑú Îç∞Ïù¥ÌÑ∞Î•º ÏÑûÍ≥† batch ÌòïÌÉúÎ°ú Í∞ÄÏ†∏ÏòµÎãàÎã§.\n","train_data = tf.data.Dataset.from_tensor_slices(x_train)\n","train_data = train_data.shuffle(60000).batch(batch_size)\n","\n","def random_normal_intializer_with_stddev_1():\n","  return tf.keras.initializers.RandomNormal(mean=0.0, stddev=1.0, seed=None)\n"],"metadata":{"id":"hmdLWyHQoTKF","executionInfo":{"status":"ok","timestamp":1755355745017,"user_tz":-540,"elapsed":679,"user":{"displayName":"Îò•Íπ°ÏïÑÏ†ú","userId":"13219049976116428546"}}},"execution_count":23,"outputs":[]},{"cell_type":"markdown","source":["Îç∞Ïù¥ÌÑ∞ Ï§ÄÎπÑ Í≥ºÏ†ïÏùÄ Ïù¥Ï†ÑÍ≥º Í±∞Ïùò ÎèôÏùºÌïòÏßÄÎßå, ÏïÑÏ£º Ï§ëÏöîÌïú Ï∞®Ïù¥Ï†êÏù¥ ÌïòÎÇò ÏûàÏäµÎãàÎã§.\n","\n","- train_data = tf.data.Dataset.from_tensor_slices(x_train): Ïù¥ ÏΩîÎìúÎ•º Î≥¥ÏÑ∏Ïöî! Ïù¥Ï†Ñ Î∂ÑÎ•ò Î™®Îç∏Í≥º Îã¨Î¶¨, Îç∞Ïù¥ÌÑ∞ ÌååÏù¥ÌîÑÎùºÏù∏Ïóê Ïù¥ÎØ∏ÏßÄ Îç∞Ïù¥ÌÑ∞(x_train)Îßå ÎÑ£Ïñ¥Ï£ºÍ≥† Ï†ïÎãµ Î†àÏù¥Î∏î(y_train)ÏùÄ Ï£ºÏßÄ ÏïäÏäµÎãàÎã§. ÏôúÎÉêÌïòÎ©¥ Ïò§ÌÜ†Ïù∏ÏΩîÎçîÎäî Ï†ïÎãµÏù¥ ÌïÑÏöî ÏóÜÎäî ÎπÑÏßÄÎèÑ ÌïôÏäµÏù¥Í∏∞ ÎïåÎ¨∏Ïù¥Ï£†. Î™®Îç∏Ïùò Î™©ÌëúÎäî Ï†ïÎãµÏùÑ ÎßûÏ∂îÎäî Í≤å ÏïÑÎãàÎùº, Îç∞Ïù¥ÌÑ∞ Í∑∏ ÏûêÏ≤¥Ïùò ÌäπÏßïÏùÑ Î∞∞Ïö∞Îäî Í≤ÉÏûÖÎãàÎã§.\n","\n","- hidden1_size= 256, hidden2_size = 128: Ïù¥ Ïà´ÏûêÍ∞Ä Ïö∞Î¶¨ Î™®Îç∏Ïùò ÌïµÏã¨ÏûÖÎãàÎã§. 784Í∞úÏùò ÌîΩÏÖÄ Ï†ïÎ≥¥Î•º 256->128 Í∞úÏùò Ïà´ÏûêÎ°ú ÏïïÏ∂ïÌïòÍ≤†Îã§Îäî ÏÑ§Í≥ÑÎèÑÏ£†. Ïù¥ Í∞ÄÏû• Ï¢ÅÏùÄ Í∏∏Î™©ÏùÑ **'Î≥ëÎ™©(Bottleneck)'**Ïù¥ÎùºÍ≥† Î∂ÄÎ¶ÖÎãàÎã§.\n","\n"],"metadata":{"id":"FvVKeMJ4oojM"}},{"cell_type":"markdown","source":["## 2.3 ÎπÑÏßÄÎèÑ ÌïôÏäµ Ïò§ÏΩîÏù∏ÏΩîÎçî Î™®Îç∏ Ï†ïÏùò"],"metadata":{"id":"_NOXpfvWpBsE"}},{"cell_type":"code","source":["# tf.keras.ModelÏùÑ Ïù¥Ïö©Ìï¥ÏÑú Autoencoder Î™®Îç∏ÏùÑ Ï†ïÏùòÌï©ÎãàÎã§.\n","class AutoEncoder(tf.keras.Model):\n","  def __init__(self):\n","    super(AutoEncoder, self).__init__()\n","    # Ïù∏ÏΩîÎî©(Encoding) - 784 -> 256 -> 128\n","    self.hidden_layer_1 = tf.keras.layers.Dense(hidden1_size,\n","                                                activation='sigmoid',\n","                                                kernel_initializer=random_normal_intializer_with_stddev_1(),\n","                                                bias_initializer=random_normal_intializer_with_stddev_1())\n","    self.hidden_layer_2 = tf.keras.layers.Dense(hidden2_size,\n","                                                activation='sigmoid',\n","                                                kernel_initializer=random_normal_intializer_with_stddev_1(),\n","                                                bias_initializer=random_normal_intializer_with_stddev_1())\n","    # ÎîîÏΩîÎî©(Decoding) 128 -> 256 -> 784\n","    self.hidden_layer_3 = tf.keras.layers.Dense(hidden1_size,\n","                                                activation='sigmoid',\n","                                                kernel_initializer=random_normal_intializer_with_stddev_1(),\n","                                                bias_initializer=random_normal_intializer_with_stddev_1())\n","    self.output_layer = tf.keras.layers.Dense(input_size,\n","                                                activation='sigmoid',\n","                                                kernel_initializer=random_normal_intializer_with_stddev_1(),\n","                                                bias_initializer=random_normal_intializer_with_stddev_1())\n","\n","  def call(self, x):\n","    H1_output = self.hidden_layer_1(x)\n","    H2_output = self.hidden_layer_2(H1_output)\n","    H3_output = self.hidden_layer_3(H2_output)\n","    reconstructed_x = self.output_layer(H3_output)\n","\n","    return reconstructed_x"],"metadata":{"id":"tMJzy4mhdRkq","executionInfo":{"status":"ok","timestamp":1755355747451,"user_tz":-540,"elapsed":96,"user":{"displayName":"Îò•Íπ°ÏïÑÏ†ú","userId":"13219049976116428546"}}},"execution_count":24,"outputs":[]},{"cell_type":"markdown","source":["Ïò§ÌÜ†Ïù∏ÏΩîÎçîÏùò Ìä∏Î†àÏù¥ÎìúÎßàÌÅ¨Ïù∏ Î™®ÎûòÏãúÍ≥Ñ ‚è≥ Íµ¨Ï°∞Î•º ÏΩîÎìúÎ°ú Íµ¨ÌòÑÌïú Î∂ÄÎ∂ÑÏûÖÎãàÎã§.\n","\n","**__init__ (ÏÑ§Í≥ÑÎèÑ):**\n","\n","- Ïù∏ÏΩîÎçî (Encoder): hidden_layer_1Í≥º hidden_layer_2Í∞Ä Ïù∏ÏΩîÎçî Î∂ÄÎ∂ÑÏûÖÎãàÎã§. ÏûÖÎ†•Îêú 784Í∞úÏùò ÌîΩÏÖÄ Ï†ïÎ≥¥Î•º 256Í∞úÎ°ú, Îã§Ïãú 128Í∞úÎ°ú Ï†êÏ†ê ÏïïÏ∂ïÌï©ÎãàÎã§.\n","\n","- ÎîîÏΩîÎçî (Decoder): hidden_layer_3Í≥º output_layerÍ∞Ä ÎîîÏΩîÎçî Î∂ÄÎ∂ÑÏûÖÎãàÎã§. ÏïïÏ∂ïÎêú 128Í∞úÏùò ÌïµÏã¨ ÌäπÏßïÏùÑ Îã§Ïãú 256Í∞úÎ°ú, ÏµúÏ¢ÖÏ†ÅÏúºÎ°ú ÏõêÎ≥∏Í≥º ÎòëÍ∞ôÏùÄ 784Í∞úÎ°ú **Î≥µÏõê(ÌôïÏû•)**Ìï©ÎãàÎã§.\n","\n","- activation='sigmoid': Ïù¥ÎØ∏ÏßÄ ÌîΩÏÖÄ Í∞íÏù¥ 0Í≥º 1 ÏÇ¨Ïù¥Ïù¥ÎØÄÎ°ú, Ï∂úÎ†• Î≤îÏúÑÎ•º 0Í≥º 1 ÏÇ¨Ïù¥Î°ú ÎßûÏ∂∞Ï£ºÎäî ÏãúÍ∑∏Î™®Ïù¥Îìú Ìï®ÏàòÎ•º ÏÇ¨Ïö©ÌñàÏäµÎãàÎã§.\n","\n","**call (ÏûëÎèô Î∞©Ïãù):**\n","\n","- Îç∞Ïù¥ÌÑ∞ xÍ∞Ä Ïù∏ÏΩîÎçîÎ•º ÌÜµÍ≥ºÌïòÎ©∞ Í∞ÄÏû• ÏïïÏ∂ïÎêú ÌòïÌÉú(H2_output)Í∞Ä ÎêòÍ≥†, Ïù¥ ÏïïÏ∂ïÎêú Ï†ïÎ≥¥Í∞Ä Îã§Ïãú ÎîîÏΩîÎçîÎ•º ÌÜµÍ≥ºÌïòÎ©∞ ÏõêÎ≥∏ Ïù¥ÎØ∏ÏßÄ(reconstructed_x)Î°ú Î≥µÏõêÎêòÎäî Í≥ºÏ†ïÏùÑ Î≥¥Ïó¨Ï§çÎãàÎã§."],"metadata":{"id":"dIvjN0Ppp4a0"}},{"cell_type":"markdown","source":["## 2.4 ÏÜêÏã§ Ìï®Ïàò Ï†ïÏùò"],"metadata":{"id":"wnMLwKB5Q4-9"}},{"cell_type":"code","source":["# MSE ÏÜêÏã§ Ìï®ÏàòÎ•º Ï†ïÏùòÌï©ÎãàÎã§.\n","@tf.function\n","def mse_loss(y_pred, y_true):\n","  return tf.reduce_mean(tf.pow(y_true - y_pred, 2)) # MSE(Mean of Squared Error) ÏÜêÏã§Ìï®Ïàò\n","\n","# ÏµúÏ†ÅÌôîÎ•º ÏúÑÌïú RMSProp ÏòµÌã∞ÎßàÏù¥Ï†ÄÎ•º Ï†ïÏùòÌï©ÎãàÎã§.\n","optimizer = tf.optimizers.RMSprop(learning_rate)\n"],"metadata":{"id":"pCQkjzt7qGOb","executionInfo":{"status":"ok","timestamp":1755355750371,"user_tz":-540,"elapsed":15,"user":{"displayName":"Îò•Íπ°ÏïÑÏ†ú","userId":"13219049976116428546"}}},"execution_count":25,"outputs":[]},{"cell_type":"markdown","source":["Ïò§ÌÜ†Ïù∏ÏΩîÎçîÎ•º ÏúÑÌïú ÌõàÎ†® ÎèÑÍµ¨ÏôÄ Í∑úÏπôÏûÖÎãàÎã§.\n","\n","- ÏÜêÏã§ Ìï®Ïàò: Î∂ÑÎ•ò Î¨∏Ï†úÍ∞Ä ÏïÑÎãàÎØÄÎ°ú ÌÅ¨Î°úÏä§ ÏóîÌä∏Î°úÌîº ÎåÄÏã† **MSE(ÌèâÍ∑† Ï†úÍ≥± Ïò§Ï∞®)**Î•º ÏÇ¨Ïö©Ìï©ÎãàÎã§. ÏõêÎ≥∏ Ïù¥ÎØ∏ÏßÄÏùò ÌîΩÏÖÄ Í∞íÍ≥º Î≥µÏõêÎêú Ïù¥ÎØ∏ÏßÄÏùò ÌîΩÏÖÄ Í∞íÏù¥ ÏñºÎßàÎÇò ÎòëÍ∞ôÏùÄÏßÄ, Í∑∏ Ï∞®Ïù¥Î•º Í≥ÑÏÇ∞Ìï¥ÏÑú Î≤åÏ†êÏùÑ Îß§Í∏∞Îäî Í±∞Ï£†.\n","\n","- ÏòµÌã∞ÎßàÏù¥Ï†Ä: RMSpropÏù¥ÎùºÎäî, AdamÍ≥º Ïú†ÏÇ¨Ìïú ÏÑ±Îä• Ï¢ãÏùÄ ÏòµÌã∞ÎßàÏù¥Ï†ÄÎ•º ÏÇ¨Ïö©Ìï©ÎãàÎã§."],"metadata":{"id":"FAJCaHlqCbp5"}},{"cell_type":"markdown","source":["## 2.5 ÏµúÏ†ÅÌôî Ìï®Ïàò Ï†ïÏùò"],"metadata":{"id":"cNb-VgMxSXO7"}},{"cell_type":"code","source":["# ÏµúÏ†ÅÌôîÎ•º ÏúÑÌïú functionÏùÑ Ï†ïÏùòÌï©ÎãàÎã§.\n","@tf.function\n","def train_step(model, x):\n","  # ÌÉÄÍ≤üÎç∞Ïù¥ÌÑ∞Îäî Ïù∏ÌíãÎç∞Ïù¥ÌÑ∞ÏôÄ Í∞ôÏäµÎãàÎã§.\n","  y_true = x\n","  with tf.GradientTape() as tape:\n","    y_pred = model(x)\n","    loss = mse_loss(y_pred, y_true)\n","\n","  gradients = tape.gradient(loss, model.trainable_variables)\n","  optimizer.apply_gradients(zip(gradients, model.trainable_variables))"],"metadata":{"id":"9HP-O5TvpbSo","executionInfo":{"status":"ok","timestamp":1755355752642,"user_tz":-540,"elapsed":14,"user":{"displayName":"Îò•Íπ°ÏïÑÏ†ú","userId":"13219049976116428546"}}},"execution_count":26,"outputs":[]},{"cell_type":"markdown","source":["- train_step: Ïó¨Í∏∞Í∞Ä ÌïµÏã¨ÏûÖÎãàÎã§! y_true = x ÏΩîÎìúÎ•º Î≥¥ÏÑ∏Ïöî. 'Ï†ïÎãµ(y_true)ÏùÄ Î∞îÎ°ú ÏûÖÎ†• Îç∞Ïù¥ÌÑ∞(x) ÏûêÏã†Ïù¥Îã§' ÎùºÍ≥† Ï†ïÏùòÌïòÍ≥† ÏûàÏäµÎãàÎã§. Î™®Îç∏Ïù¥ ÏûêÍ∏∞ ÏûêÏã†ÏùÑ ÏôÑÎ≤ΩÌïòÍ≤å Î≥µÏõêÌïòÎèÑÎ°ù, Ïä§Ïä§Î°úÍ∞Ä Ïä§Ïä§Î°úÏùò Ï†ïÎãµÏßÄÍ∞Ä ÎêòÏñ¥ ÌïôÏäµÌïòÎäî Í≥ºÏ†ïÏûÖÎãàÎã§."],"metadata":{"id":"fFxyrNLopb3_"}},{"cell_type":"markdown","source":["## 2.6 Autoencoder Î™®Îç∏ ÏµúÏ†ÅÌôî Î∞è Ïã§Ìñâ"],"metadata":{"id":"U0XjiBcOq_Ue"}},{"cell_type":"code","source":["# Autoencoder Î™®Îç∏ÏùÑ ÏÑ†Ïñ∏Ìï©ÎãàÎã§.\n","AutoEncoder_model = AutoEncoder()\n","\n","# ÏßÄÏ†ïÎêú ÌöüÏàòÎßåÌÅº ÏµúÏ†ÅÌôîÎ•º ÏàòÌñâÌï©ÎãàÎã§.\n","for epoch in range(training_epochs):\n","  # Î™®Îì† Î∞∞ÏπòÎì§Ïóê ÎåÄÌï¥ÏÑú ÏµúÏ†ÅÌôîÎ•º ÏàòÌñâÌï©ÎãàÎã§.\n","  # AutoencoderÎäî Unsupervised LearningÏù¥ÎØÄÎ°ú ÌÉÄÍ≤ü Î†àÏù¥Î∏î(label) yÍ∞Ä ÌïÑÏöîÌïòÏßÄ ÏïäÏäµÎãàÎã§.\n","  for batch_x in train_data:\n","    # ÏòµÌã∞ÎßàÏù¥Ï†ÄÎ•º Ïã§ÌñâÌï¥ÏÑú ÌååÎùºÎßàÌÑ∞Îì§ÏùÑ ÏóÖÎç∞Ïù¥Ìä∏Ìï©ÎãàÎã§.\n","    _, current_loss = tr